%[text] ## Simulink Onramp
%[text] ![](text:image:9905)
%[text] If you have not used Simulink before, please work through the content of the self paced online training.
%[text] It is required that you are familiar with concepts from the modules below (55'):
%[text] - Course Overview (5)
%[text] - Simulink Graphical Environment (15)
%[text] - Inspecting Signals (10) (covers Simulink Scope Block)
%[text] - Simulink and MATLAB (10)
%[text] - Dynamic Systems in Simulink (5)
%[text] - Continuous Systems (10) \
%[text] You can access the modules here: [https://matlabacademy.mathworks.com/details/simulink-onramp/simulink](https://matlabacademy.mathworks.com/details/simulink-onramp/simulink)
