%[text] ## System Check
%[text] For the coding exercises you require the following toolboxes including their dependencies:
%[text] - Simulink Control Design (depends on Control System Toolbox and Simulink)
%[text] - Simscape Multibody (depends on Simulink and Simscape) \
%[text] The following script will check your installation. If a package is missing it will open the Add-On Explorer from where you can install it.
%[text] Please note: You might have to rerun this command if multiple packages are missing.
checkInstallation

